// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./IERC20.sol";

contract personalSafuuTrader
{
    address payable public owner;
    uint256  public BnbToSafuu; 

    uint256 public taxFactor;
    IERC20 public safuu;

constructor () {
  owner = payable(msg.sender);
  BnbToSafuu = 200000;
  //safuu = IERC20(0xE5bA47fD94CB645ba4119222e34fB33F59C7CD90);
  safuu = IERC20(0x358AA13c52544ECCEF6B0ADD0f801012ADAD5eE3); //for test
  }
    function buySafuu(uint256 amttobuy) public payable 
    {
        
        uint256 payableAmt; //18decimals
        payableAmt = (amttobuy/BnbToSafuu);
        require(msg.value ==payableAmt,"Not enough" );
        //(bool success, ) = owner.call{value: payableAmt}("");
        //require(success, "Failed to send money");
        //transfer the safuu to user
        _safeTransferFrom(safuu, address(this), msg.sender, amttobuy);
    }


    function sellSafuu(uint256 amttosell) public 
    {
    _safeTransferFrom(safuu, msg.sender, address(this), amttosell);
    //transfer BNB to user
    uint256 payableBNB; //18decimals
    payableBNB = (amttosell/BnbToSafuu);
    payable(msg.sender).transfer(payableBNB);
    (bool success, ) = msg.sender.call{value: payableBNB}("");
        require(success, "Transfer failed!");
    }

    function withdrawToOwner()
    public 
    {
       // get the amount of Ether stored in this contract
        uint amount = address(this).balance;

        // send all Ether to owner
        // Owner can receive Ether since the address of owner is payable
        (bool success, ) = owner.call{value: amount}("");
        require(success, "Failed to send Ether");
    }
    function _safeTransferFrom(
        IERC20 token,
        address sender,
        address recipient,
        uint256 amount
    ) private {
        bool sent = token.transferFrom(sender, recipient, amount);
        require(sent, "Token transfer failed");
    }
}
abstract contract ERC20Interface {
    function balanceOf(address whom) view public virtual returns (uint);
}

